import React from 'react';

class Square extends React.Component {
  constructor (props) {
    super(props);
    this.model = {
      value: null,
    };
  }
  render() {
    return (
      <button className="square" onClick = { () => this.Model({value: 'X'}) }>
        {this.model.value}
      </button>
    );
  }
}

export default Square;
